<template>
  <canvas ref="label" width="225" height="72">Your browser does not support the HTML canvas tag.</canvas>
</template>

<script>
export default {
  name: 'LabelPreview',
  props: [ 'sidea', 'sideb', 'artist', 'artistb', 'style', 'font', 'color', 'fillartist', 'filltitle', 'quotes' ],
  data: () => {
    return {
      context: null
    }
  },
  methods: {
    paintLabel: function () {
      this.paintBox()
      switch (this.style) {
        case 'arrows':
          this.paintArrows()
      }
      this.paintText()
    },
    paintBox: function () {
      //background
      this.context.fillStyle = 'white'
      if (this.filltitle === true) {
        this.context.fillStyle = this.adjust(200)
      }
      this.context.fillRect(0, 0, 225, 72)

      //border
      this.context.lineWidth = '1'
      this.context.strokeStyle = this.color
      this.context.strokeRect(0, 0, 225, 72)
    },
    paintArrows: function () {
      //wide red stripe
      this.context.fillStyle = this.color
      this.context.fillRect(0, 32, 225, 8)

      this.context.fillStyle = 'white'
      if (this.fillartist === true) {
        this.context.fillStyle = this.adjust(200)
      }
      this.context.lineWidth = '1'
      this.context.strokeStyle = this.color
      this.context.fillRect(32.5, 28, 160, 16)
      this.context.strokeRect(32.5, 28, 160, 16)

      //left triangle
      this.context.fillStyle = this.color
      this.context.beginPath()
      this.context.moveTo(32.5, 29)
      this.context.lineTo(32.5, 43)
      this.context.lineTo(38, 36.5)
      this.context.closePath()
      this.context.fill()

      // the triangle
      this.context.beginPath()
      this.context.moveTo(192.5, 29)
      this.context.lineTo(192.5, 43)
      this.context.lineTo(187, 36.5)
      this.context.closePath()
      this.context.fill()
    },
    paintText () {
      this.context.fillStyle = 'black'
      this.context.font = '11px Retro'
      this.context.textAlign = 'center'
      this.context.textBaseline = 'middle';
      this.context.fillText('"GHOSTBUSTERS"', 112.5, 15)

      this.context.fillText('RAY PARKER JR.', 112.5, 36)

      this.context.fillText('"GHOSTBUSTERS (INSTRUMENTAL)"', 112.5, 58)
    },
    adjust(amount) {
      let color = this.color
      return '#' + color.replace(/^#/, '').replace(/../g, color => ('0'+Math.min(255, Math.max(0, parseInt(color, 16) + amount)).toString(16)).substr(-2));
    }
  },
  watch: {
    color() { 
      this.paintLabel()
    },
    style() { 
      this.paintLabel()
    },
    fillartist() { 
      this.paintLabel()
    },
    filltitle() { 
      this.paintLabel()
    }
  },
  mounted: function () {
    this.context = this.$refs['label'].getContext('2d')
    this.paintLabel()
  }
}

</script>

<style>
@font-face {font-family: ATypewriter;src: url(data:font/ttf;base64,);}
@font-face {font-family: RetroCondensed;src: url(data:font/ttf;base64,);}
@font-face {font-family: Retro;src: url(data:font/ttf;base64,);}
</style>